import React, { useEffect, useState } from 'react';
import { Col, Container, Row } from 'react-bootstrap';
import { getTeamByLeague } from './API';
import './Teams.css';
function Teams() {
  // const teamsData = [
  //   {
  //     name: 'Exodus',
  //     branding: {
  //       primary: 'blue',
  //       secondary: 'darkblue',
  //       logo: '',
  //     },
  //     league: 'Flux Cup',
  //     season: 1,
  //   },
  //   {
  //     name: 'Volcanic',
  //     branding: {
  //       primary: 'red',
  //       secondary: 'darkred',
  //       logo: '',
  //     },
  //     league: 'Flux Cup',
  //     season: 1,
  //   },
  //   {
  //     name: 'Soar Academy',
  //     branding: {
  //       primary: 'yellow',
  //       secondary: 'lightblue',
  //       logo: '',
  //     },
  //     league: 'Flux Cup',
  //     season: 1,
  //   },
  // ];
  useEffect(() => {
    getTeamByLeague().then((out) => {
      console.log(out);
      setTeamByLeague(out);
    });
  }, []);

  const [teamByLeague, setTeamByLeague] = useState(false);
  return (
    <Container className='gen-page text-light' fluid>
      <Container>
        <Row>
          <Col className='p-3' md={12}>
            <center>
              <h1>Teams</h1>
              <h3>View Teams and their players below!</h3>
            </center>
          </Col>
        </Row>
        <Row>
          <div className='g-2'>
            <Col md={6} lg={3} className='d-flex align-self-center'>
              <div className='team-nameplate-name'>Plat Chat</div>
              <div className='team-nameplate-img'>
                <img
                  src='https://cdn.discordapp.com/attachments/966143296743301150/966157458491981834/Plat_Chat.png'
                  alt=''
                />
              </div>
            </Col>
            {teamByLeague &&
              Object.entries(teamByLeague).map(([key, value]) => {
                return (
                  <Row>
                    <h1>{key}</h1>
                    {value.map((e) => (
                      <div
                        className='team-nameplate'
                        style={{
                          background: e.branding.primary,
                        }}
                      >
                        <div
                          style={{
                            background: e.branding.secondary,
                            color: e.branding.primary,
                          }}
                        >
                          {`${e.name} | ${e.season}`}
                        </div>
                      </div>
                    ))}
                  </Row>
                );
              })}
          </div>
        </Row>
      </Container>
    </Container>
  );
}

export default Teams;
